import React from 'react'

import styled from 'styled-components';

import { withStyles } from '@material-ui/core/styles';
import BGTexture from '../images/ep_naturalblack.png';

function Portfolio(props) {
    const { classes } = props;
    return (
        <PortfolioWrapper style={{ backgroundImage: `url(${BGTexture})` }}>
            <h3>Portfolio</h3>
            <hr />
        </PortfolioWrapper >
    )
}

const styles = {
    card: {
        maxWidth: 405,
        margin: 20
    },
    media: {
        height: 140,
    },
};

export default withStyles(styles)(Portfolio);

const PortfolioWrapper = styled.div`
    width: 100vw;
    padding: 20px;
    min-height: 100vh;
    background: #2E3440;
    div{
        width: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-wrap: wrap;
    }
    h3{
        color: white;
        font-size: 45px;
        margin: 0;
        padding: 0;
    }
`;
